import React from "react";
import Box from "@mui/material/Box";

const LandingPage = () => {
  return (
    <Box
      sx={{
        width: "100vw",
        height: "100vh",
        bgcolor: "#eec7d0",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <Box sx={{ width: "80%", bgcolor: "blue" }}>hey</Box>
    </Box>
  );
};

export default LandingPage;
